import React from "react";
import { Typography, Paper } from "@material-ui/core";

export const ContactListItem = ({ contact }) => {
  return (
    <Paper>
      <Typography
        key={contact.id}
      >{`${contact.firstName} ${contact.lastName}`}</Typography>
    </Paper>
  );
};
